 let array = [
  { id: 1, name: "a" },
  { id: 2, name: "b" },
  { id: 3, name: "c" },
  { id: 5, name: "d" },
  { id: 1, name: "e" },
];
function unique(arr,key){
  let obj = {}
  return arr.reduce((accumulator,currentValue,currentIndex)=>{
   //keyvalueobj,
    if(!obj[currentValue[key]]){
      obj[currentValue[key]]=true
      accumulator.push(currentValue)
    }
    return accumulator
  },[])
}
