class Promise {
  constructor(executor) {
    // state
    this.state = "pending";
    // 
    this.value = undefined;
    // 
    this.reason = undefined;
    let resolve = (value) => {
      if (this.state === "pending") {
        // resolvestate
        this.state = "fulfilled";
        // 
        this.value = value;
      }
    };
    let reject = (reason) => {
      // state,reject
      if (this.state === "pending") {
        // rejectstate
        this.state = "rejected";
        // 
        this.reason = reason;
      }
    };
    // executorreject
    try {
      executor(resolve, reject);
    } catch (err) {
      reject(err);
    }
  }
}



